import { Col, Container, Row } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";
import SearchBar from "./SearchBar";
import "./App.css";

function App() {
  return (
    <Container fluid>
      <Row>
        <SearchBar />
        <Col className="border border-dark" xs={8} md={8}>
          <h1> Music History</h1>
          <p>Random Text</p>
        </Col>
      </Row>
      <Row className="border border-dark">
        <h1>Button</h1>
      </Row>
    </Container>
  );
}

export default App;
